import React from "react";
import {NavLink} from "react-router-dom";

const PageNotFound = () =>{
	return(
		<div>
			<h1>This Page does not exists.. go back to home</h1>
			<NavLink to="/">Go Back</NavLink>
		</div>
	);
};

export default PageNotFound;
